import React from 'react'
import styled from 'styled-components'
import { Icon } from '../../../../components/icon/Icon'
import { FlexWrapper } from '../../../../components/styles-components/flexwrapper/FlexWrapper'
import { theme } from '../../../../styles/Theme'

type  WorkExperiencePropsType = {
	position: string,
	location: string,
	city: string,
	time: string,
	date: string
}

export const Experience = (props: WorkExperiencePropsType) => {
	return (
		<ExperienceWrapper>
			<div>
				<p>{props.position}</p>
				<FlexWrapper gap={'40px'}>
					<ExperienceText><Icon iconId={'home'} width={'7px'} height={'9px'} viewBox={'0 0 7 9'} />{props.location}</ExperienceText>
					<ExperienceText><Icon iconId={'pin'} width={'12px'} height={'12px'} viewBox={'0 0 12 12'} />{props.city}</ExperienceText>
				</FlexWrapper>
			</div>

			<FlexWrapper direction={'column'} align={'flex-end'} gap={'10px'}>
				<p>{props.time}</p>
				<ExperienceText><Icon iconId={'date'} width={'12px'} height={'10px'} viewBox={'0 0 12 10'} />{props.date}</ExperienceText>
			</FlexWrapper>
		</ExperienceWrapper>
	)
}

const ExperienceWrapper = styled.div`
  display: flex;
  justify-content: space-between;
  gap: 20px;
  padding-bottom: 25px;
  margin-bottom: 30px;
  border-bottom: 2px solid ${theme.colors.subTitle};
`

const ExperienceText = styled.p `
  display: flex;
  align-items: center;
	justify-content: space-between;
  padding-left: 8px;

`
